function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/signUp" element={<SignUp />} />
        <Route path="/signIn" element={<SignIn />} />
        {/*<Route path="/" element={<Home />} />
        <Route path="/create-request" element={<CreateRequest />} />
        <Route path="/chatbox" element={<Chatbox />} />*/}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
